import React from 'react'
import { Container, Row, Col } from 'react-bootstrap'

function Footer() {
  return (
    <Container>
        <Row>
            <Col className='text-center py-3'>Copyright &copy; Barnsteensieraden</Col>
        </Row>
        
    </Container>
  )
}

export default Footer
